$(".btn").click(function(){
    $("#box1").animate({
        left: "500px",
        width: "250px",
        height: "250px"
    },2000).animate({
        top: "500px",
        width: "150px",
        height: "30px"
    },1500).animate({
        left:"0px",
        width:"30px",
        height:"150px"
    },2000).animate({
        top:"0px",
        width:"100px",
        height:"100px"
    },1500)
});

